function [] = MNdemo(flag)   sprintf('Keep trying')global data if (nargin ~= 0),        N = 4;    SG = [1 2 5 6];    M = [1 332; 333 859; 860 1331; 1332 1775; 1776 2279; 2280 2718];    col = ['y' ; 'r' ; 'g' ; 'b'; 'w' ; 'm'];        colordef black    %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%5     if (flag == 1), %PLOT THE DATA                 datafig = figure('BackingStore','off', ...         'Position', [229    32   562   694], ...         'Name','Data display', ...         'NumberTitle','off', ...         'Color', [.2 0.2 0.2]);                subplot(3,1,1) %FR and UA        hold on        z = 100; t = 1;        for j = 1:N,            i = SG(j);            t = (t(end)+z):((t(end)+z) + M(i,2)-M(i,1) );            plot(t,data(7,M(i,1):M(i,2)))            plot(t,(data(8,(M(i,1):M(i,2))).*80)-100,'w')            axis([0 2250 -200 600])            ylabel('Spikes / sec')            title('Firing rate (yellow) and Unit Activity (white)')                    end                subplot(3,1,2) %VELOCITIES        hold on        z = 100; t = 1;        for j = 1:N,            i = SG(j);            t = (t(end)+z):((t(end)+z) + M(i,2)-M(i,1) );            line([0 2250],[0 0])            plot(t,-data(4,M(i,1):M(i,2)),'r')            plot(t,-data(5,M(i,1):M(i,2)),'g')            plot(t,-data(6,M(i,1):M(i,2)),'m')            axis([0 2250 -200 600])            ylabel('Deg / sec')            title('Gaze (red), Eye (green) and Head (magenta) velocities')                 end                subplot(3,1,3) %POSITIONS        hold on        z = 100; t = 1;        for j = 1:N,            i = SG(j);            t = (t(end)+z):((t(end)+z) + M(i,2)-M(i,1) );            plot(t,-data(1,M(i,1):M(i,2)),'r')            plot(t,-data(2,M(i,1):M(i,2)),'g')            plot(t,-data(3,M(i,1):M(i,2)),'m')            axis([0 2250 -40 40])            ylabel('Deg')            xlabel('Time (ms)')            title('Gaze (red), Eye (green) and Head (magenta) positions')                    end                                %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%5       elseif (flag == 2), %NOS analysis                        NOSfig = figure('BackingStore','off', ...            'Position', [239   293   713   412], ...            'Name','NOS analysis', ...            'NumberTitle','off', ...            'Color', [.2 0.2 0.2]);                        NOS=[]; dE=[]; dG=[]; dH=[];                for j = 1:N,            i = SG(j);            NOS(i) = sum(data(8,M(i,1)+50:M(i,2)-200));            dG(i) = -(data(1,M(i,2)-200) - data(1,M(i,1)+50));            dE(i) = -(data(2,M(i,2)-200) - data(2,M(i,1)+50));            dH(i) = -(data(3,M(i,2)-200) - data(3,M(i,1)+50));        end                for j = 1:N            i = SG(j);            subplot(1,2,1)            hold on            plot(dG(i),NOS(i),'o', 'color' , col(i))            axis([0 70 0 70])            ylabel('Total NOS (sp)')            xlabel('Total gaze displacement (deg)')                        subplot(1,2,2)            hold on            plot(dE(i),NOS(i),'o', 'color' , col(i))            axis([0 70 0 70])            xlabel('Total eye displacement (deg)')        end                dG                subplot(1,2,1)                %refline is from the statistical plotting toolbox in stats toolbox        %refline( (NOS(6) - NOS(1))/(dG(6) - dG(1)) , (NOS(1) - (NOS(6) - NOS(1))/(dG(6) - dG(1))*dG(1)) )        %I think it probably does a linear fit so I just kludged one in.         slope=(NOS(6) - NOS(1))/(dG(6) - dG(1)) ;        yint=(NOS(1) - (NOS(6) - NOS(1))/(dG(6) - dG(1))*dG(1));                fixit = [0 yint;70 slope*70 + yint];        plot(fixit(:,1),fixit(:,2));        title('Full sample R^2 = 0.88')                subplot(1,2,2)        %refline( (NOS(6) - NOS(1))/(dE(6) - dE(1)) , (NOS(1) - (NOS(6) - NOS(1))/(dE(6) - dE(1))*dE(1)) )        title('Full sample R^2 = 0.74')        slope=(NOS(6) - NOS(1))/(dE(6) - dE(1))        yint=(NOS(1) - (NOS(6) - NOS(1))/(dE(6) - dE(1))*dE(1))                fixit = [0 yint;70 slope*70 + yint];                plot(fixit(:,1),fixit(:,2));                h = msgbox('For each gaze shift, the total number of spikes (NOS) that the neuron fired during the movement was plotted versus the amplitude of the gaze or eye movement (in degrees)');        set(h,'color',[.3 .3 .3]);                                        %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%5    elseif (flag == 3), %Dynamic analysis                DYNfig = figure('BackingStore','off', ...            'Position', [249   270   713   412], ...            'Name','Dynamic analysis', ...            'NumberTitle','off', ...            'Color', [.2 0.2 0.2]);                hold on        z = 100; t = 1;        for j = 1:N,            i = SG(j);            t2 = (t(end)+z+50) : ((t(end)+z) + M(i,2)-M(i,1)-200);            t = (t(end)+z):((t(end)+z) + M(i,2)-M(i,1) );                                fill_fr = patch([t(1)-1 t t(end)+1],[0 data(7,M(i,1):M(i,2))+10 0],'y');                        plot(t2-10,( 104 - 5.*data(1,M(i,1)+50:M(i,2)-200) - 0.5.*data(4,M(i,1)+50:M(i,2)-200) ), 'r' , 'linewidth' , 1.5)            plot(t2-10,( 104 - 5.*data(2,M(i,1)+50:M(i,2)-200) - 0.5.*data(5,M(i,1)+50:M(i,2)-200) ), 'g' , 'linewidth' , 1.5)                                    h = line([t2(1) t2(1)], [-50 500]);            set(h,'color','w','linestyle',':');            h = line([t2(end) t2(end)], [-50 500]);            set(h,'color','w','linestyle',':');                        axis([0 2250 -50 500])            ylabel('Spikes / second')            xlabel('Time (ms)')            title('Firing rate (yellow), Gaze based prediction (red; VAF = -0.2), Eye based prediction (green; VAF = 0.3)')        end                        h = msgbox('On a large data set of head-restrained saccades, the parameters b, k, and r in the model [FR(t) = b + k*E(t) + r*E''(t)] were estimated. Here, these same parameters were used to PREDICT the activity of the neuron during gaze shifts, using either eye movement traces OR gaze movement traces in the model. A VAF parameter (Variance-Accounted-For) was utilized to quantify the goodness-of-fit of each model to the data.') ;        set(h,'color',[.3 .3 .3]);                                %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%5         elseif (flag == 4), %Phase plane plot analysis                Phasefig = figure('BackingStore','off', ...            'Position', [259   248   713   412], ...            'Name','Phase plane plot analysis', ...            'NumberTitle','off', ...            'Color', [.2 0.2 0.2]);                subplot(1,2,1)        hold on        for j = 1:N,            i = SG(j);            plot( -((data(1,M(i,1)+60:M(i,2)-190)) - data(1,M(i,1)+60)) , cumsum(data(8,M(i,1)+50:M(i,2)-200)) , '.' , 'color' , col(i) )        end        xlabel('Instantaneous gaze disp. (deg)')        ylabel('Instantaneous NOS (sp)')        axis([0 80 0 80])                subplot(1,2,2)        hold on        for j = 1:N,            i = SG(j);            plot( -((data(2,M(i,1)+60:M(i,2)-190)) - data(2,M(i,1)+60)) , cumsum(data(8,M(i,1)+50:M(i,2)-200)) , '.' , 'color' , col(i))        end        xlabel('Instantaneous eye disp. (deg)')        axis([0 80 0 80])                        h = msgbox('For each gaze shift, the number of spikes that have been fired since the onset of the movement are plotted (millisecond by millisecond) as a function of the change in gaze or eye position since the onset of the movement.');        set(h,'color',[.3 .3 .3]);                                %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%5        elseif (flag == 5), %ANSWER # 1                Answfig = figure('BackingStore','off', ...            'Position', [269   226   713   412], ...            'Name','Why? #1', ...            'NumberTitle','off', ...            'Color', [.2 0.2 0.2]);                        subplot(1,2,1)        hold on        for j = 1:N,            i = SG(j);            plot( -((data(1,M(i,1)+60:M(i,2)-190)) - data(1,M(i,1)+60)) , cumsum(data(8,M(i,1)+50:M(i,2)-200)) , '.' , 'color' , col(i) )        end        xlabel('Instantaneous gaze disp. (deg)')        ylabel('Instantaneous NOS (sp)')        axis([0 80 0 80])                q = line([0 42.85],[44 44]);        set(q,'color','w','linestyle',':');        q = line([42.85 42.85],[0 44]);        set(q,'color','w','linestyle',':');                q = text(10,50,'Total NOS');        set(q,'color','m')        q = line([20 0],[48 44]);        set(q,'color','m','linestyle','-');                q = text(50,6,'Total gaze disp.');        set(q,'color','m')        q = line([60 42.85],[4 0]);        set(q,'color','m','linestyle','-');                                subplot(1,2,2)        hold on        for j = 1:N,            i = SG(j);            plot( -((data(2,M(i,1)+60:M(i,2)-190)) - data(2,M(i,1)+60)) , cumsum(data(8,M(i,1)+50:M(i,2)-200)) , '.' , 'color' , col(i))        end        xlabel('Instantaneous eye disp. (deg)')        axis([0 80 0 80])                q = line([0 37.75],[44 44]);        set(q,'color','w','linestyle',':');        q = line([37.75 37.75],[0 44]);        set(q,'color','w','linestyle',':');                q = text(10,50,'Total NOS');        set(q,'color','m')        q = line([20 0],[48 44]);        set(q,'color','m','linestyle','-');                q = text(50,6,'Total gaze disp.');        set(q,'color','m')        q = line([60 37.75],[4 0]);        set(q,'color','m','linestyle','-');                h = msgbox('The last point of a phase plane curve gives the total number of spikes (projection on the y-axis) and the total gaze or eye displacement (projection on the x-axis) for a gaze shift. Therefore, the NOS analysis only utilizes this point to summarize gaze shift data. From these plots, you can see that the curves in the gaze panel are a lot more straigth than those in the eye panel. This is because the eyes often stop (vertical sections) or reverse direction before the end of gaze shifts (see raw data). Also note that gaze displacement does not saturate (i.e. no vertical sections) during gaze shifts. So, because the cumulative NOS can only increase monotonically during a gaze shift (you cannot remove a spike), and because the gaze displacement increases more monotonically than the eye displacement, it follows that better relationships will be observed between the total NOS and the total gaze displacement. This is a coincidence, and it does NOT indicate that this neuron better encodes the motion of the gaze axis!');        set(h,'color',[.3 .3 .3]);                                        %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%5        elseif (flag == 6), %ANSWER # 2                Answ2fig = figure('BackingStore','off', ...            'Position', [279   204   713   412], ...            'Name','Why? #2', ...            'NumberTitle','off', ...            'Color', [.2 0.2 0.2]);                subplot(1,2,1)        hold on        for j = 1:N,            i = SG(j);            plot( -((data(1,M(i,1)+60:M(i,2)-190)) - data(1,M(i,1)+60)) , cumsum(data(8,M(i,1)+50:M(i,2)-200)) , '.' , 'color' , col(i) )          end                for j = 1:N,            i = SG(j);            if (j == 1) | (j == 2)                gazepp = cumsum( 104 - 5.*data(2,M(i,1)+60:M(i,2)-190) - 0.5.*data(5,M(i,1)+60:M(i,2)-190) )./1000;                plot( -((data(1,M(i,1)+60:M(i,2)-190)) - data(1,M(i,1)+60)) , gazepp , '-' , 'color' , 'g' , 'linewidth' , 3 )            end          end                xlabel('Instantaneous gaze disp. (deg)')        ylabel('Instantaneous NOS (sp)')        title('Green curves: integrated model fits (for yellow and magenta trials)')        axis([0 80 0 80])                subplot(1,2,2)        hold on        for j = 1:N,            i = SG(j);            plot( -((data(2,M(i,1)+60:M(i,2)-190)) - data(2,M(i,1)+60)) , cumsum(data(8,M(i,1)+50:M(i,2)-200)) , '.' , 'color' , col(i))        end                for j = 1:N,            i = SG(j);            if (j == 1) | (j == 2)                eyepp = cumsum( 104 - 5.*data(1,M(i,1)+60:M(i,2)-190) - 0.5.*data(4,M(i,1)+60:M(i,2)-190) )./1000;                plot( -((data(2,M(i,1)+60:M(i,2)-190)) - data(2,M(i,1)+60)) , eyepp , '-' , 'color' , 'g' , 'linewidth' , 3 )            end        end                xlabel('Instantaneous eye disp. (deg)')        axis([0 80 0 80])                        h = msgbox('For two of the example gaze shifts, the model fits obtained with the dynamic analysis using EYE traces were integrated and plotted as a function of the change in gaze or eye position. Strickingly, the obtained phase plane curves predicted the more linear relationship of the cumulative NOS with gaze than with eye displacement. The first order EYE dynamics of the oculomotor plant can therefore account for the results of the NOS analysis');        set(h,'color',[.3 .3 .3]);                    end;             %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%5    else        h = msgbox('Hello! This short demo was designed to let you visualize some data that I recorded in Dr Cullen''s lab. It also shows you the results of two analysis approaches that were applied to this data. To make this a little more challenging, I will ask you, based on the results of both approaches, to decide if this neuron better encoded the motion of the gaze or the motion of the eye. Do both methods agree? If not, why? Which one will give you the most accurate answer?   Good luck, Pierre A. Sylvestre')    set(h,'color',[.3 .3 .3]);        getdata;        clc        gui = figure('BackingStore','off', ...        'Position', [10    32   136   326], ...        'Name','Analysis demo', ...        'NumberTitle','off', ...        'Color', [.2 0.3 0.5], ...        'MenuBar', 'none');            h_plot = uicontrol('Parent',gui, ...        'Callback', 'MNdemo(1)', ...        'Position',[10 288 120 30], ...        'String','Plot raw data', ...        'Tag','Pushbutton1', ...        'Fontsize',12, ...        'BackgroundColor', [1 .5 0.2], ...        'ForegroundColor',[.2 .95 0.6]);        h_NOS = uicontrol('Parent',gui, ...        'Callback','MNdemo(2)', ...        'Position',[10 240 120 30], ...        'String','NOS analysis', ...        'Tag','Pushbutton1', ...        'Fontsize',12, ...        'BackgroundColor',  [.2 .95 0.6], ...        'Foregroundcolor',[1 .5 0.2]);        h_DYN = uicontrol('Parent',gui, ...        'Callback','MNdemo(3)', ...        'Position',[10 192 120 30], ...        'String','Dynamic analysis', ...        'Tag','Pushbutton1', ...        'Fontsize',12, ...        'BackgroundColor',[1 .5 0.2], ...        'ForegroundColor',[.2 .95 0.6]);        h_Phase = uicontrol('Parent',gui, ...        'Callback','MNdemo(4)', ...        'Position',[10 96 120 30], ...        'String','Phase plane plot', ...        'Tag','Pushbutton1', ...        'Fontsize',12, ...        'BackgroundColor',[.2 .95 0.6], ...        'Foregroundcolor',[1 .5 0.2]);                h_Diff = uicontrol('Parent',gui, ...         'Callback','h = msgbox(''Well, yes! The most striking difference between these analysis approaches is that based on the NOS analysis, we should conclude that this neuron encoded the motion of the gaze axis (i.e. better correlation using gaze displacement). On the other hand, the dynamic analysis suggests that this same neuron better encoded the motion of the eye (i.e. better fit with the eye-based prediction). But which analysis should we pick?                                                      [Hint: the phase plane plots might help you understand the (rather 